import DataTable from 'react-data-table-component';
import { Link } from 'react-router-dom';
import Employee from './Employee';

const columns = [
    {
        name: 'First Name',
        selector: row => row.firstName,
        sortable: true,
    },
    {
        name: 'Last Name',
        selector: row => row.lastName,
        sortable: true,
    }
];

const data = [
    {
        id: 1,
        firstName: 'Nick',
        lastName: 'MacRoy',
        year: '1995',
    },
    {
        id: 2,
        firstName: 'Nick',
        lastName: 'MacRoy',
        year: '1995',
    },
]

const Employees = () => {
    return (
        <div>
            <table>
                <thead>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Options</th>
                </thead>
                <tbody>
                    {data.map(emp => 
                        <tr key={emp.id}>
                            <td>{emp.firstName}</td>
                            <td>{emp.lastName}</td>
                            <td>
                                <Link to={{pathname: "/employee", state: {emp}}}>Hi</Link>
                            </td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
}

export default Employees
